button.11:
button {
	outline: none;
	display: flex;
	align-items: center;
	justify-items: center;
	background-color: #232329;
	color: #fff3e9;
	border-radius: 5px;
	border: 1px #454551 solid;
	padding: 10px;
	cursor: pointer;
	position: relative;
	transition: all 180ms;
	will-change: transform;
	overflow: visible;
}

button > * {
	z-index: 1;
	position: relative;
}

button:hover {
	background: linear-gradient(180deg, #2b2b31 0%, #232329 100%);
	border-color: #6b6b75;
	transform: translateY(-3px) scale(1.02);
}

button:active {
	border-color: #454551;
	transform: translateY(0px) scale(1.02);
}

button:hover::after {
	opacity: 1;
	transform: translate(-50%, -50%) scale(1.02);
}

link.11:
a {
	position: relative;
	display: inline-block;
	text-decoration: none;
}

a::after {
	content: '';
	position: absolute;
	left: 50%;
	bottom: -4px;
	width: 100%;
	height: 1px;
	background: currentColor;
	border-radius: 2px;
	transform: translateX(-50%) scaleX(0);
	transform-origin: center;
	transition:
		transform 200ms,
		opacity 150ms;
	opacity: 0.95;
	pointer-events: none;
}

a:hover::after,
a:focus::after {
	transform: translateX(-50%) scaleX(1);
	opacity: 1;
}

card.11:
.card {
		padding: 15px;
		padding-top: 0px;
		width: 350px;
		height: fit-content;
		background-color: #232329;
		border-radius: 5px;
		border: 1px #454551 solid;
		margin-right: 5px;
		margin-top: 5px;
}
.card:hover {
		cursor: pointer;
		transition: all ease-in 120ms;
		background: linear-gradient(180deg, #2b2b31 0%, #232329 100%);
		border-color: #6b6b75;
}
